/// Find the coherency pair for a word (binary search)
/// Returns the pair ID if the word is part of a coherency pair
pub fn get_en_coherency_pair(word: &str) -> Option<usize> {
	EN_COHERENCY_LOOKUP
		.binary_search_by_key(&word, |(w, _)| *w)
		.ok()
		.map(|idx| EN_COHERENCY_LOOKUP[idx].1)
}

/// Get all variants for a pair ID
pub fn get_en_coherency_variants(pair_id: usize) -> Option<&'static [&'static str]> {
	EN_COHERENCY_PAIRS.get(pair_id).map(|p| p.variants)
}
